import React from "react";
import styles from"./Window.module.css"

const WindowProduct =(props)=>{

    return<div className={styles.window}>{props.oneApple.name}{props.oneXiaomi.name}
    <div>
        <img src={props.oneXiaomi.photo || props.oneApple.photo} />
    </div>
    </div>
}

export default WindowProduct;
